import {useState} from 'react';
const Home = () => {
    const [blogs, setblogs] = useState([
        {title:'My new website',body:'lorem',author:'mario',id:1},
        {title:'Welcome',body:'lorem',author:'yoshi',id:2},
        {title:'Hello',body:'lorem',author:'luigi',id:3}
    ]);
        return (
        <div className="home">
            {blogs.map((blog) =>(
            <div className="blog-preview" key={blog.id}>
            <h2>{blog.title}</h2>
            <p>Written by {blog.author}</p>
            </div>
            ))}
        </div>
    );
}

export default Home
